import './App.css';
import React, {useState,useEffect} from 'react';
import axios from 'axios';

function App() {
  const[data,setData] = useState();
  const getData = async () => {
    let reponse = await axios.get('http://localhost:8080/get')
    .then((Response)=>{
      console.log('Response.data')
    })
    .catch((Error) =>{
      console.log(Error);
    })
  }

  useEffect(()=>{
    getData();
  },[]);

  return (
    <div className="App">
      <header className="App-header">
        <h1>axios Test</h1>
      </header>
    </div>
  );
}

export default App;
